  false,\n\t\"url\": null,\n\t\"notes\": \"The Maryland Department of Housing and
  Community Development offers multifamily finance programs for the construction and
  rehabilitation of affordable rental housing units for low to moderate income families,
  senior citizens and individuals with disabilities.rnrnOur multifamily bond programs
  issues tax-exempt and taxable revenue mortgage bonds to finance the acquisition,
  preservation and creation of affordable multifamily rental housing units in priority
  funding areas.rnrnBy advocating for increased production of rental housing units,
  we help create much-needed jobs and leverage opportunities to live, work and prosper
  for hardworking Maryland families, senior citizens, and individuals with disabilities
  throughout the state.u200brnrnDISCLAIMER: Some of the information may be tied to
  the Departmentu2019s bond funded loan programs and should not be relied upon in
  making an investment decision. The Department provides comprehensive quarterly and
  annual financial information and operating data regarding its bonds and bond funded
  loan programs, all of which is posted on the publicly-accessible Electronic Municipal
  Market Access system website (commonly known as EMMA) that is maintained by the
  Municipal Securities Rulemaking Board, and on the Departmentu2019s website under
  Investor Information. The links are: http://www.mdhousing.org/Website/Investor/Default.aspxhttp://emma.msrb.org/\",\n\t\"license_title\":
